        seconds = Math.floor(milliseconds / 1000);
    //the floor function drops the decimal portion
    //returning the non fractional minutes
        minutes = Math.floor(seconds / 60);
    //Once the minutes have been calculated, then
    //the seconds is replaced with those seconds not
    //accounted for by the minutes
        seconds = seconds % 60;
    //The same sequence as used for minutes/seconds
    //then used to calulate minutes, hours, dayss, weeks, years

        hours = Math.floor(minutes / 60);
        minutes = minutes % 60;
        days = Math.floor(hours / 24);
        hours = hours % 24;
        weeks = Math.floor(days / 7)
        days = days % 7;
        years = Math.floor(days / 365.25)
