// Conceptually the flow is keeping track of how many down internet hosts there are per the ping results.
// This function does 1/4th of that process whenever it is triggered. It is triggered when the ping status node recieves a  numeric quantity from the ping result.
// The 3 things this funtion does are:
//      1. decrement the down count
//      2. whenever the down count reaches 0 and the internet down boolean is true, then this means the internet is back up so then:
//          a. set internet down boolean back to false
//          b. record the time/date it came back up
//          c. set the boolean that it is time to write the outage (to google sheet) to true
//      3. set the flow variable that the internet is down

if (msg.internettarget){
    var downCount = flow.get("downcount")
    var originalDownCount = downCount
    flow.set("calculateandwriteoutage",false)
    if(!isNaN(downCount)){
        if(downCount > 0){
            downCount--
            if(downCount === 0 && flow.get("internetdown")) {
                flow.set("internetdown", false)
                flow.set("cameupat",Date.now())
                flow.set("calculateandwriteoutage",true)
            }
        }
    }
    flow.set("downcount", downCount);
//note a msg is passed along to the write to google portion of the flow only if the calculate and write outage boolean is true
//by note returning a msg, that portion of the flow is otherwise not triggered
    if(flow.get("calculateandwriteoutage")){
        return msg;
    }
}


