//This function checks if the pinged target is an internet host of local to the LAN host and then only does something for internet hosts
//Assuming it is an internet host it creates input to be sent to the InfluxDB. This includes the hostname, IP address and 2 indicators of if the pinged target responded or not
//At least for now both a boolean and numeric are sent as Chronograf doesn't seem to know how to handle boolean, but hopefully Grafana with discrete plugin will
var targetIP = msg.topic
var targetName = msg.pingtarget
var pingresult = msg.payload
if (msg.internettarget) {
    if (pingresult) {
        combinedObj = [
            {
                Connected: true,
                ConnectedNumeric: 1
            },
            {
                TargetName: targetName,
                TargetIPAddress: targetIP
            }
        ];
    } else {
        combinedObj = [
            {
                Connected: false,
                ConnectedNumeric: 0
            },
            {
                TargetName: targetName,
                TargetIPAddress: targetIP
            }
        ];
    }
    msg.payload = combinedObj
    return msg;
}

