/* isvalidJSONstring
        This function was found on the internet to check if an input is valid JSON
        There seems to be a belief that there should be some more elegant method that trying parse and the catching the error,
        but no one seems to have demonstrated what that more elegant way would be
 */
function isvalidJSONstring(str)
{
//1. Try to send it to JSON.parse and catch the error a false, and no error as true.
    try {JSON.parse(str);}
    catch (e) {return false;}
    return true;
}
/* issplittablevalidJSONstring
    This function decides where the JSON is made up of at least 1 key:value pair
 */
function issplittablevalidJSONstring(str) {
//1. Check to see if there is a colon (:) in the string
    if (str.includes(":")) { return true;}
    else {return false;}
}
/* isvalidarray
    This function is simply wrapping the Array.isArray, to align the function naming with the other true false functions
 */
function isvalidarray(str) {
//1. Evaluate using Array.isArray function
    if (Array.isArray(str)) {return true;}
    else {return false;}
}
/* issplittablearray
    This function identifies if the array has only a single entry or multiple entries i.e. ["Apple"] not splittable,
    ["Apple","Pear"] splittable
 */
function issplittablearray(str) {
    // If the length is more than 1, then the array has mutliple entries, but if it is just 1, then it is not splittable
    if (str.length > 1) {return true;}
    else {return false;}
}
/* simpleVsComplex
    Examines the incoming value and decides if it is a simple one that can be handled by the simple processor or complex
    complex values are like JSON, arrays or object
*/
function simpleVsComplex(passedMsgPayloadxxxValue) {
//1. Determine what type of JS item it is
    switch (typeof (passedMsgPayloadxxxValue)) {
        case "number":
        case "bigint":
        case "boolean":
    //a. number, bigint, and boolean are simple objects that can't be decomposed so return simple
            return "simple"
            break;
        case "string":
    //b. string may be one of several actual types
        //i. check if it is actually JSON
        //      and if it is then determine which type of JSON
        //      and return either splittable or unsplittable JSON 
            if (isvalidJSONstring(passedMsgPayloadxxxValue)) {
                //When it is "valid" JSON, check if it is splittable
                if (issplittablevalidJSONstring(passedMsgPayloadxxxValue)) {
                    //When it is splittable, then return type as splittable JSON
                    return "splittable JSON"
                } else {
                    //if it is JSON, but not splittable ({}, "100", 100) return unsplittable JSON
                    return "unsplittable JSON"
                }
            }
            else {
        //ii. if it isn't JSON, check if it is actually an array
        //      and if it is then determine which type of array
        //      and return either splittable or unsplittable array
                if (isvalidarray(passedMsgPayloadxxxValue)) {
                    //When it is an array, check if it is splittable
                    if (issplittablearray(passedMsgPayloadxxxValue)) {
                        //When it is splittable, return splittable Array
                        return "splittable Array"
                    } else {
                        //if the array is not splittable (["apple"]) return unsplittable array
                        return "unsplittable array"
                    }
                } else {
        //iii. if it isn't an array, return simple since it is just a simple string 
                    return "simple"
                }
            }
            break;
        case "object":
    //c. objects should be evaluated as a string
        //i. check if it is actually JSON, and if it is then determine which type of JSON and return either splittable or unsplittable JSON 
            if (isvalidJSONstring(passedMsgPayloadxxxValue)) {
                //When it is "valid" JSON, check if it is splittable
                if (issplittablevalidJSONstring(passedMsgPayloadxxxValue)) {
                    //When it is splittable, then return type as splittable JSON
                    return "complex splittable JSON"
                } else {
                    //if it is JSON, but not splittable ({}, "100, 100) return unsplittable JSON
                    return "complex unsplittable JSON"
                }
            } else {
        //ii. if it isn't JSON, check if it is actually an array, and if it is then determine which type of array and return either splittable or unsplittable array
                if (isvalidarray(passedMsgPayloadxxxValue)) {
                    //When it is an array, check if it is splittable
                    if (issplittablearray(passedMsgPayloadxxxValue)) {
                        //When it is splittable, return splittable Array
                        return "complex splittable Array"
                    } else {
                        //if the array is not splittable (["apple"]) return unsplittable array
                        return "complex unsplittable array"
                    }
                } else {
        //iii. if it isn't an array, return complex obect to be handled by code to account for an uncared for result
                    //When it is neither JSON or Array, then I have not accounted for it. If you reach this point during an
                    //  investigation, it might be worth using the example that triggered your investigation to see if the object
                    //  is really just a string (without a triggering example I have not investigated)
                    return "complex object"
                }
            }
            break;
        default:
    //d. When the type is not one that was coded for then return unhandled because the situation is by definition unhandled
            node.warn("Unexpected type of result = " + typeof (passedMsgPayloadxxxValue))
            return "unhandled"
    }
}
