function handlemsg(msg) {
    //The evaluation part of this switch/case statement determines which type of entity is in the value
    //  the key idea is that once the value is an atomic item (number, string, bool) then the message should be sent out
    //  of the node to downstream, but if the value is a splittable, then it should be split into multiple messages. These
    //  messages are then evaulated individually. They in turn are either found to have atomic entries in the value or have
    //  values that are themselves splittable.
    //  For example:
    //  JSON - each key value pair will be used to create a new msg. The msg.payload.name will be changed to add ":" and the key
    //          from the key value pair. The msg.payload.value will become the value from the key value pair
    //  Array - TBAdded
    //  Object - TBAdded
    let prepareAndSend = false
    msg.topic = msg.topic.substring(msg.topic.lastIndexOf("/") + 1);
    switch (typeofhubitatvalue(msg.payload.value, "msg.payload.value")) {
        case "splittable JSON":
            //This is for cases where the JSON is in the form of key:value where there is at least 1 pair
            //  Examples of "valid" JSON that would not be coming to this case would be {} or 100
            splitJSON(msg)
            break;
        case "splittable array":
            //This is for cases where the Array is in the form ["A","B","C"] where there is are at least 2 members
            //  SplitArray function not yet built. TBD
            splitArray(msg)
            break;
        case "unsplittable array":
            //This case is where the item is an array, but with only a single entry. The idea is to move that single
            //  value out of the array and into the value natively and then to call the recursive function to evaluate
            //  what type of item it now is and then process (split or send or extract) appropriately
            msg.payload.value = msg.payload.value[0]
            handlemsg(RED.util.cloneMessage(msg))
            break;
        case "object":
            //This is for handling an object. It then calls splitObj to create multiple msgs with the object keys into the names
            //  and the values from those keys moved into the value of the new object.
            splitObj(msg)
            break
        case "number":
        case "bigint":
        case "boolean":
            //send the version of the msg with an atomic value to downstream nodes
            prepareAndSend = true
            break;
        case "string":
            //Strings are an atomic type of value and should be sent to downstream nodes
        if (msg.payload.hasOwnProperty('name'))
            {}
            else
            {
                if (msg.topic.includes("/"))
                {
                    msg.payload.name = msg.topic.substring(msg.topic.lastIndexOf("/") + 1);
                }
                else
                {
                    msg.payload.name = msg.topic
                }
            }
            prepareAndSend = true
            break;
        case "unsplittable JSON":
            //This is for handling "valid" JSON that does not have key:value pairs.
            //  Examples of "valid" JSON that are handed here are {} or 100 or "100"
            //  This case either treats it as a string (no changes made) or a number where a number in
            //  a string like "100" is changed into an actual number like 100

            //by checking if NaN, if it is a number 100 or "100", the ++ followed by -- changes it to a number 100
            //  without changing its actual value
            if (isNaN(msg.payload.value)) { } else {
                ++msg.payload.value;
                --msg.payload.value;
            }
            prepareAndSend = true
            break
        default:
            //This is just in case no valid process is found by the typeofhubitatvalue function.
            //  If you encounter this then you will either need to investigate the function or contact tmichael in
            //  Hubitat discourse forums https://community.hubitat.com/
            return
    }
    if (prepareAndSend) {
        // node.warn(msg)
        tempReading = msg.payload.value
        tempMeasure = msg.payload.name












        msg.payload[tempMeasure]={name:tempMeasure, value:tempReading, deviceId:msg.deviceId}
        // node.warn(tempMeasure)
        // node.warn(tempReading)
        // node.warn(msg)
        //!insert the deviceId lookup built for hombridge here
        // node.send(msg)
        prepareAndSend = false
        delete msg.deviceId
        delete msg.payload.value
        delete msg.payload.name
        delete msg.qos
        delete msg.retain
        delete msg._msgid
        delete msg.deviceID
        delete msg.MQTTName
        node.send([null,msg])
    }
}

/*
 * This function is used by the Main recursive function (handlemsg) to decide whether to send the msg on as
 *  the msg.payload.value is atomic or if it needs to split the value into multiple msgs
 *
 */
function typeofhubitatvalue(value, source = "") {
    switch (typeof (value)) {
        case "number":
            //atomic just return the result of typeof
            return "number"
            break;
        case "bigint":
            //atomic just return the result of typeof
            return "bigint"
            break;
        case "boolean":
            //atomic just return the result of typeof
            return "boolean"
            break;
        case "string":
            //most splittable values are encoded strictly as text and so may be identified as a string

            //Fist check if the string is "valid" JSON
            if (isvalidJSONstring(value)) {
                //When it is "valid" JSON, check if it is splittable
                if (issplittablevalidJSONstring(value)) {
                    //When it is splittable, then return type as splittable JSON
                    return "splittable JSON"
                }
                else {
                    //if it is JSON, but not splittable ({}, "100, 100) return unsplittable JSON
                    return "unsplittable JSON"
                }
            }
            else {
                //When it isn't "valid" JSON, check if it is an array
                if (isvalidarray(value)) {
                    //When it is an array, check if it is splittable
                    if (issplittablearray(value)) {
                        //When it is splittable, return splittable Array
                        return "splittable Array"
                    }
                    else {
                        //if the array is not splittable (["apple"]) return unsplittable array
                        return "unsplittable array"
                    }
                }
                else {
                    //When it is neither JSON or Array, then it is really just a string, so return string
                    return "string"
                }
            }
            break;
        case "object":
            //some  splittable values are identified as objects

            //Fist check if the object is "valid" JSON
            if (isvalidJSONstring(value)) {
                //When it is "valid" JSON, check if it is splittable
                if (issplittablevalidJSONstring(value)) {
                    //When it is splittable, then return type as splittable JSON
                    return "splittable JSON"
                }
                else {
                    //if it is JSON, but not splittable ({}, "100, 100) return unsplittable JSON
                    return "unsplittable JSON"
                }
            }
            else {
                //When it isn't "valid" JSON, check if it is an array
                if (isvalidarray(value)) {
                    //When it is an array, check if it is splittable
                    if (issplittablearray(value)) {
                        //When it is splittable, return splittable Array
                        return "splittable Array"
                    }
                    else {
                        //if the array is not splittable (["apple"]) return unsplittable array
                        return "unsplittable array"
                    }
                }
                else {
                    //When it is neither JSON or Array, then I have not accounted for it. If you reach this point during an
                    //  investigation, it might be worth using the example that triggered your investigation to see if the object
                    //  is really just a string (without a triggering example I have not investigated)
                    return "object"
                }
            }
            break;
        default:
            //When the type is not one that I coded for then return unhandled because the situation is by definition unhandled
            return "unhandled"
            break;
    }
}

