/*
 * This function was found on the internet to check if an input is valid JSON
 * There seems to be a belief that there should be some more elegant method that trying parse and the catching the error,
 * but no one seems to have demonstrated what that more elegant way would be
 */
function isvalidJSONstring(str) {
    try {
        JSON.parse(str);
    } catch (e) {
        return false;
    }
    return true;
}

/*
 * This function decides where the JSON is made up of at least 1 key:value pair
 */
function issplittablevalidJSONstring(str) {
    if (str.includes(":")) {
        return true;
    }
    else {
        return false;
    }
}
/*
 * This function is simply wrapping the Array.isArray, to align the function naming with the other true false functions
 */
function isvalidarray(str) {
    if (Array.isArray(str)) {
        return true;
    }
    else {
        return false;
    }
}
/*
 * This function identifies if the array has only a single entry or multiple entries i.e. ["Apple"] not splittable,
 *  ["Apple","Pear"] splittable
 */
function issplittablearray(str) {
    // If the length is more than 1, then the array has mutliple entries, but if it is just 1, then it is not splittable
    if (str.length > 1) {
        return true;
    }
    else {
        return false;
    }
}

//Splitting functions
/*
 * This function takes in a msg where msg.payload.value is splittable JSON and iterates through all key:value pairs and then
 *  recursively calls handlemsg with multiple messages. Each new message retains most of the details of the input message, 
 *  but the name and value are changed.
 *  The name has the key from the key:value pair appended with a : as a seperator
 *  The value is replaced with the value from the key:value pair
 *  A new message is created for each key:value pair
 */
function splitJSON(latestMsg) {
    //put the inputs value into a variable for easier access
    var valueJSON = JSON.parse(latestMsg.payload.value);
    //put the inputs name aside for multiple reuses
    var name = latestMsg.payload.name
    //Iterative loop
    Object.keys(valueJSON).forEach(function (key) {
        //concatenate the original name, a colon and the key from the pair
        if (typeof name === 'undefined') 
        {
            latestMsg.payload.name = key;
        } 
        else 
        {
            latestMsg.payload.name = name + "/" + key;
        }
        //move the value from the pair to payload.value
        latestMsg.payload.value = valueJSON[key];
        //recursively call this function in case the value is itself splittable
        handlemsg(RED.util.cloneMessage(latestMsg))
    }
    )
    return
}

/*
 * This function takes in a msg where msg.payload.value is splittable object
 *  and iterates through all key:value pairs and then
 *  recursively calls handlemsg with multiple messages. Each new message retains most of the details of the input message,
 *  but the name and value are changed.
 *  The name has the key from the key:value pair appended with a : as a seperator
 *  The value is replaced with the value from the key:value pair
 *  A new message is created for each key:value pair
 *  
 *  Note: While working on the splitArray function, I realized that I may not have tested this on an object value with multiple
 *  pairs, so it is possible that the function only handles the first pair
 */
function splitObj(oMsg) {
    //put the inputs name aside for multiple reuses
    var name = oMsg.payload.name
//Iterative loop
    for (let [key, value] of Object.entries(oMsg.payload.value)) {
        if ((value !== null) && (key !== null)) {
            oMsg.payload.name = name + "/" + key;
            oMsg.payload.value = value;
            //recursively call this function in case the value is itself splittable
            handlemsg(RED.util.cloneMessage(oMsg))
        }
    }
}

/*
 * Note: At the time of creation, I did not have a live example and had too many other things in the works to construct one.
