    //  of the node to downstream, but if the value is a splittable, then it should be split into multiple messages. These
    //  messages are then evaulated individually. They in turn are either found to have atomic entries in the value or have
    //  values that are themselves splittable.
    //  For example:
    //  JSON - each key value pair will be used to create a new msg. The msg.payload.name will be changed to add ":" and the key
    //          from the key value pair. The msg.payload.value will become the value from the key value pair
    //  Array - TBAdded
    //  Object - TBAdded
    let prepareAndSend = false
    msg.topic = msg.topic.substring(msg.topic.lastIndexOf("/") + 1);
    switch (typeofhubitatvalue(msg.payload.value, "msg.payload.value")) {
        case "splittable JSON":
            //This is for cases where the JSON is in the form of key:value where there is at least 1 pair
            //  Examples of "valid" JSON that would not be coming to this case would be {} or 100
            splitJSON(msg)
            break;
        case "splittable array":
            //This is for cases where the Array is in the form ["A","B","C"] where there is are at least 2 members
            //  SplitArray function not yet built. TBD
            splitArray(msg)
            break;
        case "unsplittable array":
            //This case is where the item is an array, but with only a single entry. The idea is to move that single
            //  value out of the array and into the value natively and then to call the recursive function to evaluate
            //  what type of item it now is and then process (split or send or extract) appropriately
            msg.payload.value = msg.payload.value[0]
            handlemsg(RED.util.cloneMessage(msg))
            break;
        case "object":
            //This is for handling an object. It then calls splitObj to create multiple msgs with the object keys into the names
            //  and the values from those keys moved into the value of the new object.
            splitObj(msg)
            break
        case "number":
        case "bigint":
        case "boolean":
            //send the version of the msg with an atomic value to downstream nodes
            prepareAndSend = true
            break;
        case "string":
            //Strings are an atomic type of value and should be sent to downstream nodes
        if (msg.payload.hasOwnProperty('name'))
            {}
            else
            {
                if (msg.topic.includes("/"))
                {
                    msg.payload.name = msg.topic.substring(msg.topic.lastIndexOf("/") + 1);
                }
                else
                {
                    msg.payload.name = msg.topic
                }
            }
            prepareAndSend = true
            break;
