            //This is for handling "valid" JSON that does not have key:value pairs.
            //  Examples of "valid" JSON that are handed here are {} or 100 or "100"
            //  This case either treats it as a string (no changes made) or a number where a number in
            //  a string like "100" is changed into an actual number like 100

